import React from "react";
import "./style.css";
const MentorApprove = () => {
  return (
    <div>
    <nav class="navigation">
        <ul>
          <li><a href="/">Home</a></li>
          <li><a href="/#/about">About Us</a></li>
          <li><a href="/#/mentor/loged/request">Requests</a></li>
          <li><a href="/#/resource">Resource</a></li>
        </ul>
    </nav>
    <h1>Thank you!</h1>
    <h3>
          Your information has been sent to Janet.</h3>
    </div>
  );
};

export default MentorApprove;
